import "../styles/home.css";
import github from "../assets/images/social_media_icons";

export default function SocialMedia(props) {
	return (
		<div className="socialMedia">
			<a
				href={props.lien}
				target="_blank"
				rel="noreferrer"
			>
                <div className="logo"></div>
                {props.name}

			</a>
		</div>
	);
}
